import React from 'react';
import Header from './Header';
import Footer from './Footer';
import HomeMainSection from './HomeMainSection';

const Homepage = () => {
  return (
    <div>
      <Header />
      <HomeMainSection />
      <Footer />
    </div>
  );
};

export default Homepage;
